import React from 'react'
import { Tabs,Button } from 'antd';
import { Rate } from 'antd';
import { Card } from 'antd';

export default function demo() {
    const { TabPane } = Tabs;

    const onChange = (key) => {
        console.log(key);
    };
    const { Meta } = Card;

    return(
        <div className='list_table' style={{ padding: '50px',height:'600px'}}>
            <Tabs defaultActiveKey="1" onChange={onChange}>
                <TabPane tab="欧美专区" key="1">
                    {/*<div style={{marginLeft:'50px'}}><Button>最新</Button><Button>最热</Button><Button>好评</Button></div>*/}
                    <div className='camera' style={{ padding: '50px',height:'600px',width:'300px',float: 'left'}}>
                    <p>电影一《伯爵夫人》</p>
                    <Card
                        hoverable
                        style={{
                            width: 240,
                        }}
                        cover={<img alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" />}
                    >
                        <Meta title="Europe Street beat" description="www.instagram.com" />
                    </Card>
                    </div>
                    <div className='camera' style={{ padding: '50px',height:'600px',width:'300px',float: 'left'}}>
                    <p>电影一《伯爵夫人》</p>
                    <Card
                        hoverable
                        style={{
                            float:'left',
                            width: 240,
                        }}
                        cover={<img alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" />}
                    >
                        <Meta title="Europe Street beat" description="www.instagram.com" />
                    </Card>
                    </div>
                    <div className='camera' style={{ padding: '50px',height:'600px',width:'300px',float: 'left'}}>
                    <p>电影一《伯爵夫人》</p>
                    <Card
                        hoverable
                        style={{
                            float:'left',
                            width: 240,
                        }}
                        cover={<img alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" />}
                    >
                        <Meta title="Europe Street beat" description="www.instagram.com" />
                    </Card>
                    </div>
                    <div className='camera' style={{ padding: '50px',height:'600px',width:'300px',float: 'left'}}>
                    <p>电影一《伯爵夫人》</p>
                    <Card
                        hoverable
                        style={{
                            float:'left',
                            width: 240,
                        }}
                        cover={<img alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" />}
                    >
                        <Meta title="Europe Street beat" description="www.instagram.com" />
                    </Card>
                    </div>
                </TabPane>
                <TabPane tab="港台专区" key="2">
                    <Rate />
                    <p>电影二《摩登时代》</p>
                    <Card
                        hoverable
                        style={{
                            width: 240,
                        }}
                        cover={<img alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" />}
                    >
                        <Meta title="Europe Street beat" description="www.instagram.com" />
                    </Card>
                </TabPane>
                <TabPane tab="大陆专区" key="3">
                    <Rate />
                    <p>电影三《《碟中谍5》</p>
                    <Card
                        hoverable
                        style={{
                            width: 240,
                        }}
                        cover={<img alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" />}
                    >
                        <Meta title="Europe Street beat" description="www.instagram.com" />
                    </Card>
                </TabPane>
            </Tabs>
        </div>
    )

}
